@matiaswalkerp Sinvergüenza qlio. Que el niño BORIC les "regalara" el proceso constituyente, NO significa que eres parte de el.

Que rabia por la cresta

BASURA CONCERTA!!!

@JosCarlosJmnz El peligro es que el proceso constituyente lo van a iniciar ellos...
No veo mamera de pararlos.
Con todos los medios en su mano, el TC y el TS en sus manos que acabarán avalando todas sus fechorías y dominando todas las instituciones, yo lo veo complicado.

@gabrielboric - gastar dinero en plebiscito o un posterior proceso constituyente SERÍA LO MÁS ABSURDO que se podría hacer.
- tienes que mirar esta pandemia como una guerra, las prioridades son sobrevivir para después levantarnos y después de uno o dos años de "normalidad"...

5/

@APRUEBO_CC_NC Sabis que ya se había escrito una nueva Constitución, en los Cabildos Ciudadanos todos los que participamos aportamos .
La presidenta la presento para que un gobierno de continuidad terminara ese proceso Constituyente.
No se pudo porque el egoísmo fue más fuerte.

Porque necesitamos un cambio. Necesitamos una vida digna para nosotros y los que vengan, nuestros hijos!
No queremos una sociedad de esclavos.
No somos súbditos.
Proceso Constituyente ya!!!
